contracts/EnumsLibrary.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

library EnumsLibrary {
    enum NieStatus { inLocalProduction, RequestedNie, ApprovedNie } 
    enum OrderStatus { OrderPlaced, OrderShipped, OrderCompleted }
    enum StatusCertificate { Requested, Approved }
    enum ObatAvailability { Ready, Sold }
    enum Roles { Factory, PBF, BPOM, Retailer }
    enum TipeProduk { obatTradisional, suplemenKesehatan }
    enum TipePermohonanCpotb { Tablet, Kapsul, KapsulLunak, SerbukOral, CairanOral, CairanObatDalam, CairanObatLuar, EdibleFilm, Pil }
    enum TipePermohonanCdob { ObatLain, CCP }
}

contracts/MainSupplyChain.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "hardhat/console.sol";
import "./RoleManager.sol";
import "./EnumsLibrary.sol";

contract MainSupplyChain {

  RoleManager roleManager;

  constructor(address _roleManagerAddr) {
    roleManager = RoleManager(_roleManagerAddr);
  }

  using EnumsLibrary for EnumsLibrary.Roles;
  using EnumsLibrary for EnumsLibrary.TipePermohonanCpotb;
  using EnumsLibrary for EnumsLibrary.StatusCertificate;
  using EnumsLibrary for EnumsLibrary.TipePermohonanCdob;

  modifier onlyFactory() { 
    require(roleManager.hasRole(msg.sender, EnumsLibrary.Roles.Factory), "Access restricted to Factory role");
    _;
  }
 
  modifier onlyBPOM() {
    require(roleManager.hasRole(msg.sender, EnumsLibrary.Roles.BPOM), "Access restricted to BPOM role");
    _;
  }
 
  modifier onlyPBF() {
    require(roleManager.hasRole(msg.sender, EnumsLibrary.Roles.PBF), "Access restricted to PBF role");
    _; 
  }

  struct st_userCertificate {
    string userName;
    address userAddr;
    string userInstanceName;
  }

  struct st_certificateDetails {
    EnumsLibrary.StatusCertificate status;
    uint timestampRequest;
    uint timestampApprove;
    st_userCertificate sender;
    st_userCertificate bpom; 
  }

  struct st_cpotb {
    string cpotbId;
    string cpotbNumber;
    st_certificateDetails details;
    EnumsLibrary.TipePermohonanCpotb tipePermohonan;
  }

  struct st_cdob {
    string cdobId;
    string cdobNumber;
    st_certificateDetails details;
    EnumsLibrary.TipePermohonanCdob tipePermohonan;
  }

  struct st_certificateRequest {
    string certId;
    string senderName;
    string senderInstance;
  }

  struct st_certificateApproval {
    string certNumber;
    string certId;
    string bpomName;
    string bpomInstance;
  }

  struct st_certificateList {
    string certId;
    string certNumber;
    string instanceName;
    string certificateType;
    uint8 tipePermohonan;
    EnumsLibrary.StatusCertificate status;
  }

  mapping (string => st_cpotb) public cpotbDataById;
  mapping (string => st_cdob) public cdobDataById;
  mapping(string => uint8[]) public approvedTipePermohonanByFactory;

  st_certificateList[] public allCertificateData;

  event evt_UserRegistered(address userAddr, string name, string instanceName, uint8 role);
  event evt_cpotbRequested(string factoryInstance, address factoryAddr, EnumsLibrary.TipePermohonanCpotb, uint timestampRequest);
  event evt_cpotbApproved(string bpomInstance, address bpomAddr, EnumsLibrary.TipePermohonanCpotb, string cpotbId, uint timestampApproved);
  event evt_cdobRequested(string pbfInstance, address pbfAddr, EnumsLibrary.TipePermohonanCdob tipePermohonan, uint timestampRequest);
  event evt_cdobApproved(string bpomInstance, address bpomAddr, EnumsLibrary.TipePermohonanCdob, string cdobNumber, uint timestampApproved);

  // status: 200ok
  function registerUser(
    string memory _name, 
    string memory _instanceName,
    address _userAddr,
    uint8 _userRole
  ) public {

    roleManager.registerUser(_name, _instanceName, _userAddr, EnumsLibrary.Roles(_userRole)); 

    if(_userRole == uint8(EnumsLibrary.Roles.Factory)) {
      st_certificateRequest memory autoCpotb = st_certificateRequest({
        certId: 'aauhd8j',
        senderName: "TAKAKI YUYA",
        senderInstance: 'PT. Budi Pekerti'
      }); 
      requestCpotb(autoCpotb, 0); 

      st_certificateApproval memory approve = st_certificateApproval({
        certNumber: "aSAJK-ASFDAS",
        certId: 'aauhd8j',
        bpomName: 'NILOJURI',
        bpomInstance: 'BPOM Makassar'
      });

      approveCpotb(approve, 0); 
    }

    emit evt_UserRegistered(_userAddr, _name, _instanceName, uint8(_userRole)); 
  }

  // status: 200ok
  function getRegisteredUser(address _userAddr) 
    public view returns (
      address, 
      string memory, 
      string memory, uint8
    ) {

      (string memory name, string memory instanceName, address userAddr, EnumsLibrary.Roles role) = roleManager.getRegisteredUser(_userAddr);
       
      return (userAddr, name, instanceName, uint8(role)); 
  }

  // status: 200ok
  function createUserCertificate(
    string memory _userName,
    address _userAddr,
    string memory _userInstanceName
  ) internal pure returns (st_userCertificate memory) {
      return st_userCertificate({
          userName: _userName,
          userAddr: _userAddr,
          userInstanceName: _userInstanceName
      });
  }

  // status: 200ok
  function createCertificateDetails(
    st_userCertificate memory _sender,
    st_userCertificate memory _bpom
  ) internal view returns (st_certificateDetails memory) {
      return st_certificateDetails({
          status: EnumsLibrary.StatusCertificate.Requested,
          timestampRequest: block.timestamp,
          timestampApprove: 0,
          sender: _sender,
          bpom: _bpom
      });
  }

  // status: 200ok
  function createCertificateList(
    string memory _certId,
    string memory _certNumber,
    string memory _instanceName,
    uint8 _tipePermohonan,
    string memory _certificateType,
    EnumsLibrary.StatusCertificate _status
  ) internal pure returns (st_certificateList memory) {
      return st_certificateList({
        certId: _certId,
        certNumber: _certNumber,
        instanceName: _instanceName,
        certificateType: _certificateType,
        tipePermohonan: _tipePermohonan,
        status: _status
      });
  }

  // status: 200ok
  function requestCpotb(
    st_certificateRequest memory requestData,
    uint8 _tipePermohonanCpotb
  ) public onlyFactory {

      require(bytes(cpotbDataById[requestData.certId].cpotbId).length == 0, "CPOTB ID already exists");

      st_userCertificate memory userFactory = createUserCertificate(requestData.senderName, msg.sender, requestData.senderInstance);
      st_userCertificate memory userBpom = createUserCertificate("", address(0), "");

      st_certificateDetails memory certficateDetails = createCertificateDetails(userFactory, userBpom);

      cpotbDataById[requestData.certId] = st_cpotb({
          cpotbId: requestData.certId,
          cpotbNumber: "", 
          details: certficateDetails,
          tipePermohonan: EnumsLibrary.TipePermohonanCpotb(_tipePermohonanCpotb)
      });

      st_certificateList memory certificateList = createCertificateList(
          requestData.certId,
          "", 
          requestData.senderInstance, 
          uint8(EnumsLibrary.TipePermohonanCpotb(_tipePermohonanCpotb)),
          "cpotb",
          EnumsLibrary.StatusCertificate.Requested
      );

      allCertificateData.push(certificateList); 

      emit evt_cpotbRequested(requestData.senderInstance, msg.sender,EnumsLibrary.TipePermohonanCpotb(_tipePermohonanCpotb), block.timestamp); 
  }

  // status: 200ok(make it onlyBPOM)
  function approveCpotb(
    st_certificateApproval memory approvalData,
    uint8 _tipePermohonanCpotb
  ) public  {

      st_cpotb storage cpotbData = cpotbDataById[approvalData.certId];

      require(bytes(cpotbData.cpotbId).length > 0, "CPOTB not found");
      require(cpotbData.details.status == EnumsLibrary.StatusCertificate.Requested, "CPOTB status must be 'Requested'");

      cpotbData.details.bpom = createUserCertificate(approvalData.bpomName, msg.sender, approvalData.bpomInstance);

      cpotbData.details.status = EnumsLibrary.StatusCertificate.Approved;
      cpotbData.details.timestampApprove = block.timestamp;
      cpotbData.cpotbNumber = approvalData.certNumber;

      string memory factoryInstance = cpotbData.details.sender.userInstanceName;

      approvedTipePermohonanByFactory[factoryInstance].push(
        uint8(EnumsLibrary.TipePermohonanCpotb(_tipePermohonanCpotb))
      );

      for (uint i = 0; i < allCertificateData.length; i++) {
        if (keccak256(abi.encodePacked(allCertificateData[i].certId)) == keccak256(abi.encodePacked(approvalData.certId))) {
          allCertificateData[i].certNumber = approvalData.certNumber;
          allCertificateData[i].status = EnumsLibrary.StatusCertificate.Approved;
        } 
      }

      emit evt_cpotbApproved(approvalData.bpomInstance, msg.sender, EnumsLibrary.TipePermohonanCpotb(_tipePermohonanCpotb), approvalData.certNumber, block.timestamp);
  }

  // status: 200ok
  function approvedTipePermohonan(string memory _factoryName)
    public view returns (uint8[] memory){ 
      return approvedTipePermohonanByFactory[_factoryName];
  } 

  // status: 200ok
  function countCertificateByInstance(string memory _instanceName) 
    internal view returns (uint8){
      uint8 count = 0;

      for (uint i = 0; i < allCertificateData.length; i++) {
        if(keccak256(abi.encodePacked(allCertificateData[i].instanceName)) == keccak256(abi.encodePacked(_instanceName))){
          count++;
        }
      }

      return count;
  }

  // status: 200ok
  function countCertificateByType(string memory _certType) 
    internal view returns (uint8){
      uint8 count = 0;
      bytes32 certTypeHash = keccak256(abi.encodePacked(_certType));

      for (uint i = 0; i < allCertificateData.length; i++) {
        if(keccak256(abi.encodePacked(allCertificateData[i].certificateType)) == certTypeHash){
          count++;
        }
      }

      return count;
  }

  // status: 200ok
  function getListAllCertificateByInstance(string memory _instanceName)
    public view returns ( st_certificateList[] memory){
      uint8 countCertificate = countCertificateByInstance(_instanceName);

      st_certificateList[] memory filteredCertificates = new st_certificateList[](countCertificate);

      uint8 index = 0;

      for (uint256 i = 0; i < allCertificateData.length; i++) {
        if (keccak256(abi.encodePacked(allCertificateData[i].instanceName)) == keccak256(abi.encodePacked(_instanceName))) {
          filteredCertificates[index] = allCertificateData[i];
          index++;
        }
      }

      return filteredCertificates;
  }

  // status: 200ok
  function getListAllCpotb()
    public view returns (st_certificateList[] memory){
      uint8 countCertificate = countCertificateByType("cpotb");

      bytes32 certTypeHash = keccak256(abi.encodePacked("cpotb"));

      st_certificateList[] memory filteredCertificates = new st_certificateList[](countCertificate);

      uint8 index = 0;

      for (uint256 i = 0; i < allCertificateData.length; i++) {
        if (keccak256(abi.encodePacked(allCertificateData[i].certificateType)) == certTypeHash) {
          filteredCertificates[index] = allCertificateData[i];
          index++;
        }
      }

      return filteredCertificates;
  }

  // status: 200ok
  function detailCpotb (string memory _certId)
    public view returns ( st_cpotb memory ){
    return cpotbDataById[_certId];
  }

  // status: 200ok
  function requestCdob(
    st_certificateRequest memory requestData,
    uint8 _tipePermohonanCdob
  ) public onlyPBF {

      require(bytes(cdobDataById[requestData.certId].cdobId).length == 0, "CDOB ID already exists");

      st_userCertificate memory userPbf = createUserCertificate(requestData.senderName, msg.sender, requestData.senderInstance);
      st_userCertificate memory userBpom = createUserCertificate("", address(0), "");

      st_certificateDetails memory certficateDetails = createCertificateDetails(userPbf, userBpom);

      cdobDataById[requestData.certId] = st_cdob({
          cdobId: requestData.certId,
          cdobNumber: "", 
          details: certficateDetails,
          tipePermohonan: EnumsLibrary.TipePermohonanCdob(_tipePermohonanCdob)
      });

      st_certificateList memory certificateList = createCertificateList(
          requestData.certId,
          "", 
          requestData.senderInstance, 
          uint8(EnumsLibrary.TipePermohonanCdob(_tipePermohonanCdob)),
          "cdob",
          EnumsLibrary.StatusCertificate.Requested
      );

      allCertificateData.push(certificateList); 

      emit evt_cdobRequested(requestData.senderInstance, msg.sender,EnumsLibrary.TipePermohonanCdob(_tipePermohonanCdob), block.timestamp); 
  }

  // status: 200ok
  function approveCdob(
    st_certificateApproval memory approvalData,
    uint8 _tipePermohonanCdob
  ) public onlyBPOM {

      st_cdob storage cdobData = cdobDataById[approvalData.certId];

      require(bytes(cdobData.cdobId).length > 0, "CDOB not found");
      require(cdobData.details.status == EnumsLibrary.StatusCertificate.Requested, "CDOB status must be 'Requested'");

      cdobData.details.bpom = createUserCertificate(approvalData.bpomName, msg.sender, approvalData.bpomInstance);

      cdobData.details.status = EnumsLibrary.StatusCertificate.Approved;
      cdobData.details.timestampApprove = block.timestamp;
      cdobData.cdobNumber = approvalData.certNumber;

      for (uint i = 0; i < allCertificateData.length; i++) {
        if (keccak256(abi.encodePacked(allCertificateData[i].certId)) == keccak256(abi.encodePacked(approvalData.certId))) {
          allCertificateData[i].certNumber = approvalData.certNumber;
          allCertificateData[i].status = EnumsLibrary.StatusCertificate.Approved;
        } 
      }

      emit evt_cdobApproved(approvalData.bpomInstance, msg.sender, EnumsLibrary.TipePermohonanCdob(_tipePermohonanCdob), approvalData.certNumber, block.timestamp);
  }

  // status: 200ok
  function getListAllCdob()
    public view returns (st_certificateList[] memory){
      uint8 countCertificate = countCertificateByType("cdob");

      bytes32 certTypeHash = keccak256(abi.encodePacked("cdob"));
 
      st_certificateList[] memory filteredCertificates = new st_certificateList[](countCertificate);

      uint8 index = 0;

      for (uint256 i = 0; i < allCertificateData.length; i++) {
        if (keccak256(abi.encodePacked(allCertificateData[i].certificateType)) == certTypeHash) {
          filteredCertificates[index] = allCertificateData[i];
          index++;
        }
      }

      return filteredCertificates;
  }

  // status: 200ok
  function detailCdob(string memory _certId)
    public view returns ( st_cdob memory ){
    return cdobDataById[_certId];
  }

}

contracts/ObatTradisional.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "hardhat/console.sol";
import "./RoleManager.sol";
import "./MainSupplyChain.sol";
import "./EnumsLibrary.sol";
 
contract ObatTradisional {

  RoleManager public roleManager;
  MainSupplyChain public mainSupplyChain; 

  constructor(address _roleManagerAddr, address _mainSupplyChainAddr) {
    roleManager = RoleManager(_roleManagerAddr);
    mainSupplyChain = MainSupplyChain(_mainSupplyChainAddr);
  }

    modifier onlyFactory() { 
    require(roleManager.hasRole(msg.sender, EnumsLibrary.Roles.Factory), "Access restricted to Factory role");
    _;
  } 

  modifier onlyPBF() {
    require(roleManager.hasRole(msg.sender, EnumsLibrary.Roles.PBF), "Access restricted to PBF role");
    _;
  }

  modifier onlyBPOM() {
    require(roleManager.hasRole(msg.sender, EnumsLibrary.Roles.BPOM), "Access restricted to BPOM role");
    _;
  }

  using EnumsLibrary for EnumsLibrary.NieStatus;
  using EnumsLibrary for EnumsLibrary.OrderStatus;
  using EnumsLibrary for EnumsLibrary.ObatAvailability;
  using EnumsLibrary for EnumsLibrary.Roles;
  using EnumsLibrary for EnumsLibrary.TipeProduk;
  using EnumsLibrary for EnumsLibrary.TipePermohonanCpotb;

  struct st_obatDetails {
    string merk;
    string namaProduk;
    string[] klaim;
    string[] komposisi;
    string kemasan; 
    EnumsLibrary.TipeProduk tipeProduk;
    string factoryInstance;
    address factoryAddr;
  }

  struct st_obatNie {
    string nieNumber; 
    EnumsLibrary.NieStatus nieStatus;   
    uint256 timestampProduction;
    uint256 timestampNieRequest;       
    uint256 timestampNieApprove;  
    string bpomInstance;      
    address bpomAddr;
  }

  struct st_obatOutputNie {
    string obatId;
    string namaProduk;
    string nieNumber;
    EnumsLibrary.NieStatus nieStatus;
    string factoryInstance;
  }

  struct st_obatProduction {
    EnumsLibrary.ObatAvailability statusStok;
    string namaProduk;
    string batchName;
    uint8 obatQuantity;
    string[] obatIpfs;
    string factoryInstance; 
  }

  struct st_obatOutputBatch {
    string obatId;
    string namaProduk;
    string batchName;
    uint8 obatQuantity;
    EnumsLibrary.ObatAvailability statusStok;
    string factoryInstance;
  }

  string[] public allObatIds;
  
  mapping (string => st_obatNie) public obatNieById;
  mapping (string => st_obatDetails) public obatDetailsById;
  mapping(string => st_obatProduction[]) public obatProductionById;

  event evt_obatCreated(string namaProduk, string factoryInstance, address factoryAddresses);
  event evt_nieRequested(string factoryInstance, address factoryAddr,uint timestampRequest);
  event evt_nieApproved(string bpomInstance, address bpomAddr, string nieNumber, uint timestampApproved);
  event evt_addBatchProduction(string batchName, uint8 quantity, string namaProduk, string factoryInstance);

  function getJenisSediaanAvail(string memory _factoryInstanceName)
    public 
    view 
    returns(
      uint8[] memory
  ) {
     uint8[] memory approvedJenisSediaan = mainSupplyChain.approvedTipePermohonan(_factoryInstanceName); 
     return approvedJenisSediaan;
  }

  // status: 200ok
  function createDetailObat (
    string memory _merk,
    string memory _namaPoduk,
    string[] memory _klaim,
    string[] memory _komposisi,
    string memory _kemasan,
    EnumsLibrary.TipeProduk _tipeProduk,
    string memory _factoryInstance,
    address _factoryAddr
  ) internal pure returns (st_obatDetails memory){
      return st_obatDetails({
        merk: _merk,
        namaProduk: _namaPoduk,
        klaim: _klaim,
        komposisi: _komposisi,
        kemasan: _kemasan,
        tipeProduk: _tipeProduk,
        factoryInstance: _factoryInstance,
        factoryAddr: _factoryAddr
      });
  }

  // status: 200ok
  function createObatNie(
    EnumsLibrary.NieStatus _nieStatus,
    uint256 _timestampProuction
  ) internal pure returns (st_obatNie memory){
    return st_obatNie({
      nieNumber: "",
      nieStatus: _nieStatus,
      timestampProduction: _timestampProuction, 
      timestampNieRequest: 0,
      timestampNieApprove: 0,
      bpomInstance: "",
      bpomAddr: address(0)
    }); 
  }

  // status: 200ok
  function createObat(
    string memory _obatId,
    string memory _merk,
    string memory _namaProduk,
    string[] memory _klaim,
    string memory _kemasan,
    string[] memory _komposisi,
    string memory _factoryInstance,
    EnumsLibrary.TipeProduk _tipeProduk
  ) public onlyFactory {
      require(bytes(_obatId).length > 0, "Invalid Obat ID");

      obatDetailsById[_obatId] = createDetailObat(
        _merk,
        _namaProduk, 
        _klaim,
        _komposisi,
        _kemasan, 
        _tipeProduk, 
        _factoryInstance,
        msg.sender
      );

      obatNieById[_obatId] = createObatNie(
        EnumsLibrary.NieStatus.inLocalProduction,
        block.timestamp
      );

      allObatIds.push(_obatId);

    emit evt_obatCreated(_namaProduk, _factoryInstance, msg.sender);
  }
   
  // status: 200ok
  function getAllObat() 
    public view onlyBPOM returns (st_obatOutputNie[] memory) {

      uint256 totalObat = allObatIds.length; 

      st_obatOutputNie[] memory obatList = new st_obatOutputNie[](totalObat);

      for (uint i = 0; i < totalObat; i++) {
        string memory obatId = allObatIds[i];

        st_obatNie memory nie = obatNieById[obatId];
        st_obatDetails memory details = obatDetailsById[obatId];

        if (nie.nieStatus != EnumsLibrary.NieStatus.inLocalProduction) {
          obatList[i] = st_obatOutputNie({
              obatId: obatId,
              namaProduk: details.namaProduk,
              nieNumber: nie.nieNumber,
              nieStatus: nie.nieStatus,
              factoryInstance: details.factoryInstance
          });
          
        } 

    }

    return obatList;
  }

  // status: 200ok
  function countAllObatByInstance(string memory _factoryInstance)
    internal view returns (uint256){
      uint256 totalObat = allObatIds.length;
      uint256 count = 0;

      for (uint i = 0; i < totalObat; i++) {
        string memory obatId = allObatIds[i];

        st_obatDetails memory details = obatDetailsById[obatId];
        if (keccak256(abi.encodePacked(details.factoryInstance)) == keccak256(abi.encodePacked(_factoryInstance))) {
          count++;
        }
      }

      return count;

  }

  // status: 200ok
  function getAllObatByInstance (string memory _instanceName)
    public view onlyFactory returns (st_obatOutputNie[] memory){
      
      uint256 ownedObat = countAllObatByInstance(_instanceName);

      st_obatOutputNie[] memory filteredObatList = new st_obatOutputNie[](ownedObat);
      uint256 index = 0;
 
      for (uint i = 0; i < allObatIds.length; i++) {
        string memory obatId = allObatIds[i];
        
        st_obatDetails memory details = obatDetailsById[obatId];
        st_obatNie memory nie = obatNieById[obatId];

        if (keccak256(abi.encodePacked(details.factoryInstance)) == keccak256(abi.encodePacked(_instanceName))) {

            filteredObatList[index] = st_obatOutputNie({
                obatId: obatId,
                namaProduk: details.namaProduk,
                nieNumber: nie.nieNumber,
                nieStatus: nie.nieStatus,
                factoryInstance: details.factoryInstance
            });

            index++;
        }
    }

    return filteredObatList;
  }

  // status: 200ok
  function detailObat (string memory _obatId)
    public view returns (
      st_obatDetails memory,
      st_obatNie memory
    ){
      return (obatDetailsById[_obatId], obatNieById[_obatId]);
  }

  // status: 200ok
  function requestNie (
    string memory _obatId,
    string memory _factoryInstance
  ) public onlyFactory { 

      obatNieById[_obatId].timestampNieRequest = block.timestamp;
      obatNieById[_obatId].nieStatus = EnumsLibrary.NieStatus.RequestedNie;

      emit evt_nieRequested(_factoryInstance, msg.sender, block.timestamp );
  }

  // status: 200ok
  function approveNie (
    string memory _obatId,
    string memory _nieNumber,
    string memory _instanceName
  ) public onlyBPOM {

      obatNieById[_obatId].bpomInstance = _instanceName;
      obatNieById[_obatId].bpomAddr = msg.sender;
      obatNieById[_obatId].nieNumber = _nieNumber;
      obatNieById[_obatId].timestampNieApprove = block.timestamp;
      obatNieById[_obatId].nieStatus = EnumsLibrary.NieStatus.ApprovedNie;

      emit evt_nieApproved(_instanceName, msg.sender, _nieNumber, block.timestamp);
  }

  function addBatchProduction(
    string memory _obatId,
    string memory _batchName,
    uint8 _obatQuantity,
    string[] memory _obatIpfsHash, 
    string memory _factoryInstance
  ) public onlyFactory {

    string memory namaProduk = obatDetailsById[_obatId].namaProduk;

    st_obatProduction memory newBatch = st_obatProduction({
      statusStok: EnumsLibrary.ObatAvailability.Ready,
      namaProduk: namaProduk,
      batchName: _batchName,
      obatQuantity: _obatQuantity,
      obatIpfs: _obatIpfsHash,
      factoryInstance: _factoryInstance
    });

    obatProductionById[_obatId].push(newBatch);

    emit evt_addBatchProduction (_batchName, _obatQuantity, namaProduk, _factoryInstance);
  }

  function countAllBatchReadyStock()
    internal view returns (uint256){
      uint256 totalBatchReady = 0;
      string memory obatId;

      for (uint256 i = 0; i < allObatIds.length; i++) {

        obatId = allObatIds[i];

        st_obatProduction[] memory batchObat = obatProductionById[obatId];

        if (batchObat.length == 0) {
          continue;
        }

        for (uint256 j = 0; j < batchObat.length; j++) {
          if (batchObat[j].statusStok == EnumsLibrary.ObatAvailability.Ready) {
            totalBatchReady++;
          }
        }
      }

    return totalBatchReady;
  }

  function countAllBatchByInstance(string memory _instanceName)
    internal view returns (uint256){
      uint256 totalBatchInstance = 0;
      string memory obatId;
      bytes32 instanceHash = keccak256(abi.encodePacked(_instanceName));

      for (uint256 i = 0; i < allObatIds.length; i++) {

        obatId = allObatIds[i];

        st_obatProduction[] memory batchObat = obatProductionById[obatId];
        
        if (batchObat.length == 0) {
            continue;
        }

        for (uint256 j = 0; j < batchObat.length; j++) {
          if (keccak256(abi.encodePacked(batchObat[j].factoryInstance)) == instanceHash) {
            totalBatchInstance++;
          }
        }
      }

    return totalBatchInstance;
  }

  function createObatOutputBatch(
    string memory obatId,
    st_obatProduction memory obatBatch
  ) internal pure returns (st_obatOutputBatch memory) {
      return st_obatOutputBatch({
        obatId: obatId,
        namaProduk: obatBatch.namaProduk,
        batchName: obatBatch.batchName,
        obatQuantity: obatBatch.obatQuantity,
        statusStok: obatBatch.statusStok,
        factoryInstance: obatBatch.factoryInstance
      });
  }


  function getAllBatchProductionByInstance(string memory _instanceName)
    public view onlyFactory returns(st_obatOutputBatch[] memory){
      uint256 totalReady = countAllBatchByInstance(_instanceName);

      st_obatOutputBatch[] memory obatReadyStock = new st_obatOutputBatch[](totalReady);

      // diubah ke bytes krn lebih murah untuk gas fees nya
      bytes32 instanceHash = keccak256(abi.encodePacked(_instanceName));

      uint256 index = 0;

      for (uint256 i = 0; i < allObatIds.length; i++) {
        string memory obatId = allObatIds[i];
        st_obatProduction[] memory obatBatches = obatProductionById[obatId];

        if (obatBatches.length == 0) {
          continue;
        }

        for (uint256 j = 0; j < obatBatches.length; j++) {
          if (keccak256(abi.encodePacked(obatBatches[j].factoryInstance)) == instanceHash) {

            obatReadyStock[index] = createObatOutputBatch(obatId, obatBatches[j]); 
            index++; 
          }
        }
    }

    return obatReadyStock;
  }

  function getAllBatchProductionReadyStock()
    public view returns (
      st_obatOutputBatch[] memory
  ){
      uint256 totalReady = countAllBatchReadyStock();

      st_obatOutputBatch[] memory obatReadyStock = new st_obatOutputBatch[](totalReady);

      uint256 index = 0;

      for (uint256 i = 0; i < allObatIds.length; i++) {
        string memory obatId = allObatIds[i];
        st_obatProduction[] memory obatBatches = obatProductionById[obatId];

        if (obatBatches.length == 0) {
          continue;
        }

        for (uint256 j = 0; j < obatBatches.length; j++) {
          if (obatBatches[j].statusStok == EnumsLibrary.ObatAvailability.Ready) {
            obatReadyStock[index] = createObatOutputBatch(obatId, obatBatches[j]);
            index++;
          }
        }
    }

    return obatReadyStock;
  }

  function detailBatchProduction(
    string memory _obatId,
    string memory _batchName
  ) public view returns (st_obatProduction memory){
    st_obatProduction[] memory obatBatches = obatProductionById[_obatId];

    st_obatProduction memory obatBatchDetail;

    bytes32 batchHash = keccak256(abi.encodePacked(_batchName));

    for (uint256 i = 0; i < obatBatches.length; i++){
      if (keccak256(abi.encodePacked(obatBatches[i].batchName)) == batchHash) {
        obatBatchDetail =  obatBatches[i];
      } 
    }

    if ((roleManager.hasRole(msg.sender, EnumsLibrary.Roles.PBF))) {
      obatBatchDetail.obatIpfs = new string[](0);
    }

    return obatBatchDetail;
  }

  function updateBatchProduction(
    string memory _obatId,
    string memory _batchName,
    string[] memory _obatIpfs
  ) public view onlyPBF {
    st_obatProduction[] memory obatBatches = obatProductionById[_obatId];

    bytes32 batchHash = keccak256(abi.encodePacked(_batchName));

    for (uint256 i = 0; i < obatBatches.length; i++){
      if (keccak256(abi.encodePacked(obatBatches[i].batchName)) == batchHash) {
        obatBatches[i].statusStok = EnumsLibrary.ObatAvailability.Sold;
        obatBatches[i].obatIpfs = _obatIpfs;
      } 
    }
  }

}

